import React,{Component} from 'react';
class Landingcontent extends React.Component{
	constructor(props){
		super(props)

	}
	render(){
		return(
			<div>
			<div className="main1">
				<div className="c1">
					
				</div>
				<div className="c2">
				</div>

				<div className="c3">

				</div>
			</div>

			
			<style jsx>{`
				.main1{

					display:flex;
					flex-direction:row;
					background:black;
					height:500px;
					margin-top:80px;
					align-items:center;


				}
				.c1{
					display:flex;
					flex-basis:24%;
					background:yellow;
					height:70%;
				}

				`}</style>

			</div>

		)
	}
}
export default Landingcontent
